import React, { Component } from 'react';
import {
    Alert, Container, Row, Col, Table,
    Card, CardHeader, CardBody, CardText, CardTitle, CardFooter,
    Form, FormGroup, Label, Input, FormText, Button, Badge
} from 'reactstrap';


class TaskList extends Component {
    render() {
        return (
            <Table bordered>
                <thead>
                    <tr>
                        <th>STT</th>
                        <th>Tên công việc</th>
                        <th>Trạng thái</th>
                        <th>Hành động</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td>
                            <Badge color="success">Kích hoạt</Badge>
                        </td>
                        <td>
                            <Button color="danger">Sửa</Button>{' '}
                            <Button color="danger">Xóa</Button>
                        </td>
                    </tr>
                </tbody>
            </Table>
        );
    }
}

export default TaskList;
